import styled from "styled-components";

export const SWContainer = styled.div`
  height: 500px;
  width: 1000px;
  padding: 20px;
`;

export const SWTitleContainer = styled.div`
  display: flex;
  padding: 8px;
  text-align: center;
  justify-content: center;
  align-items: center;
  font-weight: bold;
  font-size: 20px;
`;

export const SWTitleDiv1 = styled.div`
  width: 50%;
`;

export const SWTitleDiv2 = styled.div`
  flex-grow: 1;
`;

export const SWText = styled.p`
  align-items: center;
  text-decoration: none;
  color: inherit;
  font-size: 20px;
`;

export const SWBodyContainer = styled.div`
  text-align: center;
  justify-content: center;
  padding: 20px;
`;

export const SWBodyDiv1 = styled.div`
  float: left;
  width: 33.3%;
`;

export const SWBodyDiv2 = styled.div`
  margin-left: 65px;
`;

export const SWBodyDiv3 = styled.div`
  float: left;
  width: 33.3%;
`;
